import React from "react";
import Gallery from "./Gallery"; // Importa la galería u otros componentes que deseas mostrar en el contenido principal

const Main = () => {
  return (
    <main className="main-content">
      <h1>Welcome to My New Website</h1>
      <p>This is the main content section of the website. Here you can find information and a gallery.</p>
      <Gallery />
    </main>
  );
};

export default Main;
